function Results(props){
    console.log(props.props);
   const list = props.props.list;

    return (
        <div className="Results">
            {list && list.map((data)=>{
                <div className="col-lg-4">
                    {data.state}
                </div>
            })}
        </div>
    );
}
export default Results
